pub enum ReadOutputs<'a> {
    Translations(Translations),
    Rotations(Rotations),
    Scales(Scales),
    MorphTargetWeights(MorphTargetWeights),
}

pub enum Error {
    Io(::std::io::Error),
    Version(u32),
    Magic([u8; ]),
    Length {
            length: u32,
            length_read: usize,
        },
    ChunkLength {
            ty: ChunkType,
            length: u32,
            length_read: usize,
        },
    ChunkType(ChunkType),
    UnknownChunkType([u8; ]),
}

pub enum Source<'a> {
    View {
            view: buffer::View,
            mime_type: &'a str,
        },
    Uri {
            uri: &'a str,
            mime_type: Option<&'a str>,
        },
}

pub enum Kind {
    Directional,
    Point,
    Spot {
            inner_cone_angle: f32,
            outer_cone_angle: f32,
        },
}

pub enum Transform {
    Matrix {
            matrix: [[f32; ]; ],
        },
    Decomposed {
            translation: [f32; ],
            rotation: [f32; ],
            scale: [f32; ],
        },
}

pub enum Error {
    Binary(binary::Error),
    Deserialize(json::Error),
    Io(std::io::Error),
    Validation(Vec<(json::Path, json::validation::Error)>),
}
